INSERT INTO "rate" VALUES(58,'2018-02-23 04:53:10',840,NULL,273,NULL,3,4,0,1,0,0,0,0,'P/F',0.2,1.0,0.2,1,'吴教授为人友善，专业知识渊博，发音标准。课程选择的电影绝对能让你在一学期内了解到十分完整的韩国电影发展的历史，有机会还能近距离接触影评界的专业人士。最最重要的是课业压力很轻（每周一部电影，一个disucssion response并且无ddl，一学期三个essay，平均一千左右），评分标准松，课友少，基本都能互相了解。期末结束还有一次吃白食/石锅饭的机会，是同学们上水课的不二之选。',1);
